def send_report(report):
    try:
        response = requests.post(API_URL,  data={"report": json.dumps(report)}, files={})

        # ensure request completed successfully
        response.raise_for_status()

        print(f"✅ Sent report for city: {report['city']}")
        print("Response:", response.json())

    except requests.exceptions.HTTPError as e:
        print(f"❌ Error sending report for {report['city']}: {e}")
        try:
            print("Backend response:", response.json())
        except Exception:
            print("Raw text response:", response.text)
        raise e
  


def main():
    for report in reports_data:
        send_report(report)  # 🚀 Request only goes AFTER previous finishes


if __name__ == "__main__":
    main()
